import React from "react";

import "../stylesheets/Login.css";

type LoginProps = {
  login: () => void;
};

export default function Login({ login }: LoginProps) {
  return (
    <div className="d-flex justify-content-center">
      <button className="btn login-button m-5" onClick={() => login()}>
        Login with Spotify
      </button>
    </div>
  );
}
